p=A.b([A.eR(A.b(["\ub2e4\ud2b8\ub294 \ud50c\ub7ec\ud130\ub97c \uc0ac\uc6a9\ud558\uba74\uc11c \uc790\uc5f0\uc2a4\ub7fd\uac8c \uc775\ud788\uac8c \ub418\uc5c8\uc2b5\ub2c8\ub2e4. PySide\ub97c \uc0ac\uc6a9\ud574 Qt \uc571\uc744 \uac1c\ubc1c\ud558\ub358 \uc911, \ub354 \ub2e4\uc591\ud55c \ub514\uc790\uc778\uc744 \uad6c\ud604\ud558\uace0 \uc2f6\uc5c8\uace0 \uc5ec\ub7ec \ud504\ub808\uc784\uc6cc\ud06c\ub97c \ud0d0\uc0c9\ud558\ub358 \ub05d\uc5d0 \uba40\ud2f0\ud50c\ub7ab\ud3fc \ud504\ub808\uc784\uc6cc\ud06c\uc778 \ud50c\ub7ec\ud130\ub97c \uc120\ud0dd\ud558\uac8c \ub418\uc5c8\uc2b5\ub2c8\ub2e4. \ud50c\ub7ec\ud130\uc758 \uc5b8\uc5b4\uc778 \ub2e4\ud2b8\ub294 \uc815\uc801 \ud0c0\uc785 \uc5b8\uc5b4\ub85c, C#\uc744 \uc774\ubbf8 \uc775\ud614\ub358 \uc800\uc5d0\uac8c\ub294 \uc5b8\uc5b4 \uc790\uccb4\uc758 \ub7ec\ub2dd \ucee4\ube0c\uac00 \ud06c\uc9c0 \uc54a\uc558\uc2b5\ub2c8\ub2e4. \ud558\uc9c0\ub9cc \ud50c\ub7ec\ud130\uc758 \uc0dd\uba85 \uc8fc\uae30, \uc704\uc82f\uc758 \uac1c\ub150, \uadf8\ub9ac\uace0 \uc5ec\ub7ec \uc0c1\ud0dc \uad00\ub9ac \uae30\ubc95\uc740 \uc775\ud788\ub294 \ub370 \uc2dc\uac04\uc774 \uac78\ub838\uc2b5\ub2c8\ub2e4. ","\ud50c\ub7ec\ud130\ub294 \ud50c\ub7ab\ud3fc\uc758 \ucef4\ud3ec\ub10c\ud2b8\ub97c \uc0ac\uc6a9\ud558\ub294 \ub300\uc2e0 \ubaa8\ub4e0 \uc571 \uc694\uc18c\ub97c \uc9c1\uc811 \ub80c\ub354\ub9c1\ud558\uba70, \uc571\uc758 \ub85c\uc9c1, \uc0c1\ud638\uc791\uc6a9, \ub370\uc774\ud130, \uba54\ubaa8\ub9ac \uad00\ub9ac \ub4f1 \ub300\ubd80\ubd84\uc758 \uc694\uc18c\ub97c \uc790\uccb4\uc801\uc73c\ub85c \ud50c\ub7ec\ud130 \ub7f0\ud0c0\uc784\uc5d0\uc11c \ucc98\ub9ac\ud569\ub2c8\ub2e4. \uc774\ub97c \ud1b5\ud574 \uba40\ud2f0\ud50c\ub7ab\ud3fc \ud638\ud658\uc131\uc744 \ub2ec\uc131\ud558\ub294 \ud50c\ub7ec\ud130\uc758 \uac1c\ub150\uc740 \ub9e4\uc6b0 \ub9e4\ub825\uc801\uc73c\ub85c \ub2e4\uac00\uc654\uace0, \uacb0\uad6d \ud50c\ub7ec\ud130\ub97c \uc8fc\ub825\uc73c\ub85c \uc0ac\uc6a9\ud558\uac8c \ub418\uc5c8\uc2b5\ub2c8\ub2e4."],p),null),A.eR(A.b(["\ud50c\ub7ec\ud130\ub294 \ub9e4\uc6b0 \uc778\uae30\uac00 \ub9ce\uc740 \ud504\ub808\uc784\uc6cc\ud06c\ub85c, \uc774\ubbf8 \uc0dd\ud0dc\uacc4\uac00 \uc131\uc219\ud574\uc84c\ub2e4\uace0 \ud560 \uc218 \uc788\uc2b5\ub2c8\ub2e4. \uc218\ub9ce\uc740 \ud328\ud0a4\uc9c0\uac00 \uc874\uc7ac\ud558\uc9c0\ub9cc, \ud504\ub85c\uc81d\ud2b8\uc5d0 \ub530\ub77c \ub124\uc774\ud2f0\ube0c \uae30\ub2a5\uc774 \ud544\uc694\ud560 \ub54c\uac00 \uc788\uc2b5\ub2c8\ub2e4.","\ud50c\ub7ec\ud130\ub294 \uac01 \ud50c\ub7ab\ud3fc\uc5d0\uc11c \ub7f0\ud0c0\uc784\uc5d0 \uc811\uadfc\ud560 \uc218 \uc788\ub294 \uba54\uc18c\ub4dc \ucc44\ub110\uc744 \uc81c\uacf5\ud558\uc5ec, \ub124\uc774\ud2f0\ube0c \ucee8\ud2b8\ub864\uc744 \ud50c\ub7ec\ud130 \uc571 \uc704\uc5d0 \ubc30\uce58\ud558\uac70\ub098 \ud50c\ub7ec\ud130 \ubdf0\ub97c \ub124\uc774\ud2f0\ube0c \uc571\uc5d0 \ub0b4\uc7a5\uc2dc\ud0ac \uc218 \uc788\uc2b5\ub2c8\ub2e4. \ub610\ud55c, Windows, Mac, Linux \ub4f1 \ub370\uc2a4\ud06c\ud0d1 \uc6b4\uc601\uccb4\uc81c\uc5d0\uc11c\ub294 \ub3d9\uc801 \ub77c\uc774\ube0c\ub7ec\ub9ac\ub97c \ub85c\ub4dc\ud558\uc5ec \uc0ac\uc6a9\ud568\uc73c\ub85c\uc368 \ub192\uc740 \ud655\uc7a5\uc131\uc744 \uc81c\uacf5\ud569\ub2c8\ub2e4. \ud50c\ub7ec\ud130\ub294 \ub124\uc774\ud2f0\ube0c \ud50c\ub7ab\ud3fc\ubfd0\ub9cc \uc544\ub2c8\ub77c \uc6f9\uc5d0\uc11c\ub3c4 HTML \uc694\uc18c\uc5d0 \uc811\uadfc\ud558\uac70\ub098, \ub2e4\ud2b8 \ud568\uc218\ub97c JavaScript \uc804\uc6a9\uc73c\ub85c \ub9cc\ub4e4\uc5b4 \uc2e4\ud589\ud560 \uc218 \uc788\uc5b4 \uc6f9 \uac1c\ubc1c\uc5d0\ub3c4 \ub9e4\uc6b0 \uc720\uc6a9\ud569\ub2c8\ub2e4."],p),"\ud50c\ub7ec\ud130\uc758 \uc0c1\ud638 \uc6b4\uc6a9\uc131"),A.eR(A.b(["\uc774 \ud398\uc774\uc9c0\ub294 \ud50c\ub7ec\ud130\ub85c \uc81c\uc791\ub418\uc5c8\uc73c\uba70, \ud50c\ub7ec\ud130\uc758 \uae30\ub2a5\uc744 \ucd5c\ub300\ud55c \ud65c\uc6a9\ud558\uc5ec \ub9cc\ub4e4\uc5c8\uc2b5\ub2c8\ub2e4.\ud50c\ub7ec\ud130\ub294 \uc790\uccb4 \ub80c\ub354\ub7ec\ub97c \uc0ac\uc6a9\ud558\uc5ec CustomPainter\uc640 \uc560\ub2c8\uba54\uc774\uc158\uc744 \ud1b5\ud574 \ub9e4\uc6b0 \ub2e4\ucc44\ub85c\uc6b4 \uadf8\ub798\ud53d \ud45c\ud604\uc774 \uac00\ub2a5\ud588\uc2b5\ub2c8\ub2e4. \uc774\ub7ec\ud55c \uadf8\ub798\ud53d\uc740 \uc6f9\uc5d0\uc11c\ub3c4 \uc644\ubcbd\ud558\uac8c \ub3d9\uc791\ud558\uba70, Canvas\ub97c \ud1b5\ud574 \ub80c\ub354\ub9c1\ub429\ub2c8\ub2e4. \ub355\ubd84\uc5d0 \ucc3d\uc758\uc801\uc778 \ub514\uc790\uc778 \uc544\uc774\ub514\uc5b4\ub97c \uc790\uc720\ub86d\uac8c \uad6c\ud604\ud560 \uc218 \uc788\uc5c8\uc2b5\ub2c8\ub2e4."],p),"\uace0\uae09 \uadf8\ub798\ud53d\ud45c\ud604")],t.Yg)
